    had permissible funds to donate.   2.  The O'Dwyer Realty check had a split transation
    added to it.  3.  Victor Mavar and Harry McArthur Jr.'s YTD totals did not agree
    because the previous spelling was changed.  4.  On Schedule B all missing descriptions
    were added or changed to clarify the purpose of the disbursement.  5.  One contribution's
    name was changed from Yvonne to Brett McKenzie.  6.  Haley's PAC check was refunded
    in 2011.\n"
